// Table.js
import './Table.css';
import Song from './Song.js';

function Table({ topItems, datatype }) {
    return (
        <div className='table'>
            <div className='songs'>
                {topItems.length > 0 ? topItems.map((item, index) => (
                    <Song
                        key={index}
                        title={datatype === 'tracks' ? item.name : item.name}
                        artist={datatype === 'tracks' ? item.artists[0].name : item.genres.join(', ')}
                        rank={index + 1}
                        link={datatype === 'tracks' ? item.external_urls.spotify : item.external_urls.spotify}
                        image={datatype === 'tracks' ? item.album.images[0].url : item.images[0].url}
                    />
                )) : <p>No data available</p>}
            </div>
        </div>
    );
}

export default Table;
